import React, { Component } from "react";
import "./LongBackgroundBlock.css";

class LongBackgroundBlock extends Component {
  render() {
    return <div className='LongBackgroundBlock'>
      <ul className="list-inline">
        <li className="contact-item hvr-pulse"><a className="doc-link" href="https://github.com/jp448"><i className="fab fa-github-square"> </i> GitHub</a></li>
        <li className="contact-item hvr-pulse"><a className="doc-link" href="www.linkedin.com/in/jocelyn-proctor-448448jkp"><i className="fab fa-linkedin"></i> LinkedIn</a></li>
        <li className="contact-item hvr-pulse"><a className="doc-link" href="mailto:jocelynkproctor@gmail.com"><i className="fas fa-envelope-square"></i> E-Mail</a></li>
      </ul>      
    </div>;
  }
}
export default LongBackgroundBlock;
